import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route

} from "react-router-dom";
import Login from '../pages/login/login';

function App() {



  return (
    <>

      <Router>
        <Switch>
          <Route path='/login' component={Login} />
          <Route component={Login} />
        </Switch>
      </Router>


    </>
  );
}

export default App;
